The use of a compound of formula I
   wherein R 1  and R 3  are, independently, -H, -CH 3 , -CO(C 1 -C 6  alkyl), or -COAr, where Ar is optionally substituted phenyl;
 R 3  is selected from the group consisting of pyrrolidine, piperidine, and hexamethyleneimino; or a pharmaceutically acceptable salt or solvate thereof, in the preparation of a pharmaceutical formulation for inhibiting detrimental side-effects of GnRH or a GnRH agonist in a mammal.

The use of a compound of formula I
   wherein R 1  and R 3  are, independently, -H, -CH 3 , -CO(C 1 -C 6  alkyl), or -COAr, where Ar is optionally substituted phenyl;
 R 3  is selected from the group consisting of pyrrolidine, piperidine, and hexamethyleneimino; or a pharmaceutically acceptable salt or solvate thereof, in the preparation of a pharmaceutical formulation for inhibiting detrimental side-effects of GnRH or a GnRH agonist in a mammal.

Use of a compound of formula (I):

 wherein 
   n is 0, 1 or 2; 
   R is hydroxyl, methoxy, C₁-C₇ alkanoyloxy, C₃-C₇ cycloalkanoyloxy, (C₁-C₆ alkoxy)-C₁-C₇ alkanoyloxy, substituted or unsubstituted aroyloxy, or substituted or unsubstituted aryloxycarbonyloxy; 
   R¹ is hydrogen, hydroxyl, chloro, bromo, methoxy, C₁-C₇ alkanoyloxy, C₃-C₇ cycloalkanoyloxy, (C₁-C₆ alkoxy)-C₁-C₇ alkanoyloxy, substituted or unsubstituted or aroyloxy, or substituted or unsubstituted aryloxycarbonyloxy; 
   R² is a heterocyclic ring selected from the group consisting of pyrrolidino, piperidino, or hexamethyleneimino; or a pharmaceutically acceptable salt or solvate thereof; in the preparation of a medicament useful for lowering serum cholesterol levels in animals.

The present invention provides method of treating endometriosis using novel benzothiophene compounds of formula I 

wherein 

R is H, OH, O(C _{ 1 } -C _{ 4 } alkyl), OCO(C _{ 1 } -C _{ 6 } alkyl), OCOAr in which Ar is optionally substituted phenyl, or OSO _{ 2 } (C _{ 4 } -C _{ 6 } alkyl); 

R ^{ 1 } is H, OH, O(C _{ 1 } -C _{ 4 } alkyl),, OCO(C _{ 1 } -C _{ 6 } alkyl), OCOAr in which Ar is optionally substituted phenyl, OSO _{ 2 } (C _{ 4 } -C _{ 6 } alkyl) chloro or bromo; 

R ^{ 2 } is H or OH; 

n is 2 or 3; and 

R ^{ 3 } and R ^{ 4 } each are independently C _{ 1 } -C _{ 4 } alkyl, or combine to form 1-piperidinyl, 1-pyrrolidinyl, methyl-1-pyrrolidinyl, dimethyl-1-pyrrolidinyl, 4-morpholino, or 1-hexamethyleneimino; 

or a pharmaceutically acceptable salt thereof.

The present invention provides novel benzothiophene compounds of formula I

 wherein 
   R is -H, -OH, -O(C₁-C₄ alkyl), -O-CO-(C₁-C₆ alkyl), -O-CO-Ar in which Ar is optionally substituted phenyl, or -O-SO₂-(C₄-C₆ alkyl); 
   R¹ is -H, -OH, -O(C₁-C₄ alkyl), -O-CO-(C₁-C₆ alkyl), -O-CO-Ar in which Ar is optionally substituted phenyl, -O-SO₂-(C₄-C₆ alkyl) chloro or bromo; 
   R is -H or -OH; 
   n is 2 or 3; and 
   R³ and R⁴ each are independently C₁-C₄ alkyl, or combine to form 1-piperidinyl, 1-pyrrolidinyl, methyl-1-pyrrolidinyl, dimethyl-l-pyrrolidinyl, 4-morpholino, or 1-hexamethyleneimino; 
or a pharmaceutically acceptable salt thereof. Further provided are methods for alleviating the symptoms of post-menopausal syndrome, and inhibiting endometriosis, uterine fibrosis, and aortal smooth muscle cell proliferation. Also provided are pharmaceutical formulations with formula I compounds, optionally including estrogen or progestin. The present invention further provides a process for preparing a compound of formula Ic

 wherein 
   R a  and R 1a  each are -OH or -OR⁵; 
   R³ and R⁴ each are independently C₁-C₄ alkyl, or combine to form 1-piperidinyl, 1-pyrrolidinyl, methoxy-1-pyrrolidinyl, dimethyl-l-pyrrolidinyl, 4-morpholino, or 1-hexamethyleneimino; and 
   R⁵ is a hydroxy protecting group capable of resisting reduction by a strong reducing agent; or a pharmaceutically acceptable salt thereof, which comprises
 a) optionally removing the R⁵ hydroxy protecting groups of a compound of formula II
   wherein 
   n, R³, R⁴, and R⁵ are as defined above, or a salt thereof; b) reacting said formula II compound with a reducing agent in the presence of a solvent having a boiling point in the range from about 150° C to about 200° C, and heating the mixture to reflux; and c) optionally salifying the reaction product from step b).
